// ProductCard의 내부 jsx
function ProductCardList(items) { 
    return (
        <div>
            <img src={items.images[0]} alt={items.tags} />
            <div>
                <h3>{items.name}</h3>
                <p>{items.price}</p>
                <p>{items.favoriteCount}</p>
            </div>
        </div>
    );
} 

function ProductCard(items) {
    return (
        <ui>
            {items.map((item) => (
                <li key={item.id}>
                    <ProductCardList items={item}/>
                </li>
            ))}
        </ui>
    );
}

export default ProductCard;
